;; gorilla-repl.fileformat = 1

;; **
;;; # Gaussian mixture model using exchangeable random procedures
;;; 
;;; This worksheet extends the worksheet <a href="http://www.robots.ox.ac.uk/~fwood/anglican/examples/viewer/?worksheet=gmm-iris">"Gaussian mixture model: Iris data"</a>. Here, we provide an example of implementing and using exactly the same generative probabilistic model, namely a Bayesian mixtures of Gaussians, for the purpose of doing inference on the same dataset of Iris flowers. Much text is repeated from the previous worksheet.
;;; 
;;; The original worksheet presents the model with uncollapsed conjugate pairs. That requires the inference machinery to spend a significant amount of computations on integrating the hyper-parameters by sampling them. This worksheet, in contrast, demos the collapsed version of the same model, where hyper-parameters are integrated out. From the point of view of statistics, it is possible because the model uses conjugate priors. From the point of view of probabilistic programming, it is being achieved by using exchangeable random procedures.
;; **

;; **
;;; Firstly, let us repeat the model. The <a href="https://en.wikipedia.org/wiki/Mixture_model#Multivariate_Gaussian_mixture_model">mixture of Gaussians</a> supposes that the data @@\\{ \mathbf{x}_n \\}@@ can be modeled by a mixture of up to @@K@@ different Gaussian distributions, each with a mean @@\boldsymbol{\mu}\_k@@ and a covariance matrix @@\boldsymbol{\Sigma}_k@@. Each data point @@\mathbf{x}\_n@@ is assigned to one of the clusters @@k = 1,\dots,K@@ via a latent class indicator variable @@z_n@@. The probability of any particular measurement being assigned to some class @@k@@ is given by a component-wise probability @@\pi_k@@. For details on the model, see Section 10.2 of [Bishop 2006].
;;; 
;;; In a Bayesian mixture model, we place _prior distributions_ on the hyper-parameters of the model:
;;; 
;;; $$\boldsymbol{\pi} \sim \mathrm{Dirichlet}(\alpha),$$
;;; $$\boldsymbol{\Sigma}_k \sim \mathrm{inverse\text{-}Wishart}(\mathbf{\Psi}, \nu),$$
;;; $$\boldsymbol{\mu}_k \big|\ \boldsymbol{\Sigma}_k \sim \mathrm{Normal}\hspace{-0.2em}\left(\boldsymbol{\mu}_0, \frac{1}{\lambda} \boldsymbol{\Sigma}_k \right),$$
;;; 
;;; where @@\alpha@@, @@\mathbf{\Psi}@@, @@\nu@@, @@\boldsymbol{\mu}_0@@, and @@\lambda@@ are the fixed hyper-priors that are chosen by us, based on the statistics of the observation data. The distribution over the mean and covariance of the multivariate distribution is called the Normal-inverse-Wishart distribution @@\operatorname{NiW}(\boldsymbol{\mu}_0, \lambda, \mathbf{\Psi}, \nu)@@. The fact that we are placing distributions on the hyper-parameters means that we also treat them as latent variables, in addition to indicator variables @@z_n@@.
;;; 
;;; Please, note that in contrast to the <a href="http://www.robots.ox.ac.uk/~fwood/anglican/examples/viewer/?worksheet=gmm-iris">original worksheet</a>, we work not with a *precision matrix* @@\boldsymbol{\Lambda}@@, but directly with a *covariance matrix* @@\boldsymbol{\Sigma} \equiv \boldsymbol{\Lambda}^{-1}@@; this is just for convenience. We also use the letter @@\lambda@@ instead of the letter @@\beta = \lambda@@, in order to be consistent with the definition of the <a href="https://en.wikipedia.org/wiki/Normal-inverse-Wishart_distribution">Normal-inverse-Wishart distribution</a> in Wikipedia.
;;; 
;; **

;; **
;;; We define the distribution over latent class indicators as
;;; $$z_n \big|\ \boldsymbol{\pi} \sim \mathrm{Categorical}(\boldsymbol{\pi}).$$
;;; 
;;; Finally, the likelihood of the data is defined as
;;; $$\mathbf{x}_n \big|\ z_n=k, \ \boldsymbol{\mu}_k, \ \boldsymbol{\Lambda}_k \sim \textrm{Normal}\hspace{-0.2em}\left(\ \boldsymbol{\mu}_k, \boldsymbol{\Sigma}_k \right).$$
;;; The observing variables @@\mathbf{x}_n@@ are often called emissions, and the distribution on them is called the emission distribution.
;;; 
;;; The prior distributions over hyper-parameters @@\boldsymbol{\mu}_0, \lambda, \mathbf{\Psi}, \nu@@ in this model are specifically chosen to be [conjugate](http://en.wikipedia.org/wiki/Conjugate_prior) to the emissions @@\mathbf{x}_n@@. This means that the prior distribution @@p(\boldsymbol{\mu}_0, \lambda, \mathbf{\Psi}, \nu)@@ over hyper-parameters for any cluster @@k@@ is in the same Normal-inverse-Wishart distribution family as the posterior distribution over hyper-parameters @@p(\boldsymbol{\mu}_k{'}, \lambda_k{'}, \mathbf{\Psi}_k{'}, \nu_k{'})@@ for the cluster @@k@@ given emissions @@\\{ x_i \text{ such that } z_i = k \\} @@.
;;; 
;;; Thanks to conjugacy, given the hyper-priors of the Normal-inverse-Wishart distribution @@\boldsymbol{\mu}_0, \lambda, \mathbf{\Psi}, \nu@@ and the emission values of the Gaussian emission distributions @@\mathbf{x}_i@@, the posterior hyper-priors of the posterior Normal-inverse-Wishart distribution can be calculated <a href="https://en.wikipedia.org/wiki/Conjugate_prior">as follows</a>:
;;; 
;;; $$\boldsymbol{\mu}{'} = \frac{\lambda\boldsymbol\mu_0+n\mathbf{\bar{x}}}{\lambda+n},$$
;;; $$\lambda{'} = \lambda + n,$$
;;; $$\nu{'} = \nu+n,$$
;;; $$\boldsymbol\Psi{'} = \boldsymbol\Psi + \mathbf{C} + \frac{\lambda n}{\lambda+n}(\mathbf{\bar{x}}-\boldsymbol\mu_0)(\mathbf{\bar{x}}-\boldsymbol\mu_0)^T,$$
;;; 
;; **

;; **
;;; where @@n@@ is the number of observed data points, the value @@\mathbf{\bar{x}}@@ is their mean, and $$\mathbf{C} = \sum_{i=1}^{n}{\left(\mathbf{x}_i - \mathbf{\bar{x}}\right)\left(\mathbf{x}_i - \mathbf{\bar{x}}\right)^T}.$$
;; **

;; **
;;; 
;; **

;; **
;;; Conjugate pairs can be implemented and used in certain probabilistic programming languages, including Anglican, as exchangeable random processes (XRPs). For the details from the point of view of statistics, we refer the reader to <a href="de Finetti's theorem">de Finetti's theorem and its extensions</a>. An exchangeable random procedure in Anglican, once initialised with hyper-priors, is able to produce a sequence of exchangeable random variables.
;;; 
;;; For example, to initialise a new XRP object of the Symmetric-Dirichlet-Discrete conjugate pair, we write `(def dsd-instance (XRP (DSD alpha)))`, where the @@\alpha@@ is the hyper-prior, namely the general concentration parameter for the symmetric Dirichlet distribution. To draw one sample from this XRP object, we use `(SAMPLE dsd-instance)`. To incorporate an observation into the state of this XRP, we call `(OBSERVE dsd-instance emission-value)`. Finally, new types of XRPs might be written for Anglican using the macro `defproc`. For details, please refer to the bottom part of <a href="http://www.robots.ox.ac.uk/~fwood/anglican/language/index.html#distributions">Section "Distributions"</a> on Anglican web-site.
;; **

;; **
;;; Now, let us define a new Clojure namespace for our model, and then define a collapsed XRP `niw-mvn-process` for the conjugate pair of the Normal-inverse-Wishart hyper-parameters and Normal emissions. Firstly, we define a new Clojure namespace:
;; **

;; @@
(ns gmm-iris-collapsed
  "Gaussian mixture model with collapsed conjugate pairs (XRPs)"
  (:use [anglican core runtime emit [state :only [get-predicts]]]
        [anglib xrp])
  (:require [gorilla-plot.core :as plot]
            [clojure.data.csv :as csv]
            [clojure.java.io :as io]
            [clojure.core.matrix :as m]
            [clojure.core.matrix.operators :as op]
            [clojure.core.matrix.linear :as linalg]))

(m/set-current-implementation :vectorz)
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-keyword'>:vectorz</span>","value":":vectorz"}
;; <=

;; **
;;; The posterior predictive of the Normal-inverse-Wishart distribution, given updated hyper-priors, is the multivariate t-distribution: $$t_{{\nu}'-p+1}\left(\tilde{\mathbf{x}}|{\boldsymbol\mu_0}',\frac{{\lambda}'+1}{{\lambda}'({\nu}'-p+1)}\boldsymbol\Psi'\right),$$
;;; where @@p@@ is the cardinality of @@\Psi@@.
;;; 
;;; Let us introduce to Anglican the multivariate t-distribution and the "continuous" chi-squared distribution, on which the former depends.
;;; 
;;; Along the way, we introduce a few helper produces that convert values between the Clojure vector type and the types of `clojure.core.matrix` library. The reason for that is to implement the XRP `niw-mvn-process` in the way that its inputs and outputs are matrix-typed. This is to make computations faster.
;;; 	
;;; <font color='red'><b>Have proof-read until here (only text, not code).</b></font>
;; **

;; @@
(defn produce-matrix-from-vector
  "produces a matrix (clojure.core.matrix) from a Clojure vector"
  [input-vector]
  (m/matrix (m/reshape input-vector [(count input-vector) 1])))

(defn continuous-chi-squared
  "Chi-squared distribution with
  the continuous degrees of freedom parameter"
  [nu]
  (let
    [
     ;; Chi-Squared(nu) ~ Gamma(shape = nu / 2, scale = 2.0).
     ;; In Colt library Gamma is parametrised in its second argument
     ;; by rate, where scale = 1 / rate.
     gamma-dist (gamma (* nu 0.5) 0.5)]
  (reify distribution
    (sample [this]
      (sample gamma-dist))
    (observe [this value]
      (+
        (* (- (* nu 0.5) 1) (log value))
        (* -0.5 value)
        (* -0.5 nu (log 2))
        (* -1.0 (log-gamma-fn (* 0.5 nu))))))))

(defn multivariate-t
  "multivariate T-distribution."
  ;; Implemented according to
  ;; http://en.wikipedia.org/wiki/Multivariate_t-distribution
  [nu mu Sigma]
  (let
    [p (first (m/shape Sigma))
     mvn-dist (mvn (repeat p 0.0) Sigma)
     chi-squared-dist (continuous-chi-squared nu)]
    (reify distribution
      (sample [this]
              (let
                [y (produce-matrix-from-vector (sample mvn-dist))
                 u (sample chi-squared-dist)]
                (m/add
                 (m/mul y (sqrt (/ nu u)))
                 mu)))
      (observe [this value]

               (let
                 [mmul-result
                  (m/mget (m/mmul
                           (m/transpose (m/sub value mu))
                           (m/inverse Sigma)
                           (m/sub value mu)) 0 0)]
                 (-
                  (log-gamma-fn (* 0.5 (+ nu p)))
                  (+
                   (log-gamma-fn (* 0.5 nu))
                   (* 0.5 p (log nu))
                   (* 0.5 p (log Math/PI))
                   (* 0.5 (log (m/det Sigma)))
                   (* 0.5 (+ nu p)
                      (log
                       (+ 1.0
                          (* (/ 1.0 nu)
                             mmul-result)))))))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris-collapsed/multivariate-t</span>","value":"#'gmm-iris-collapsed/multivariate-t"}
;; <=

;; **
;;; Now, let us introduce a helper procedure that calculates the posterior hyper-parameters @@\mu_0', \lambda', \boldsymbol\Psi', \nu'@@ of the Normal-inverse-Wishart distribution given the emissions @@\mathbf{x}_i@@:
;; **

;; @@
(def get-zero-matrix
  "returns a zero square matrix of the specified size"
  (memoize
   (fn [size]
    (m/matrix (repeat size (repeat size 0))))))

(def get-zero-vector-as-matrix
  "returns a zero vector of specified size in the form of a matrix"
  (memoize
   (fn [size]
    (produce-matrix-from-vector (repeat size 0)))))

;; Input: NiW-MVN initial hyperparameters, and sufficient statistics of observes.
;; Output: parameters of the posterior predictive.
(defn niw-mvn-posterior-predictive
  "returns parameters of the posterior predictive of the NiW-MVN conjugate pair"
  [mu kappa nu Psi N samples-sum samples-squared-sum]
  (let [p (first (m/shape Psi))
        samples-mean (if (> N 0) (m/mul (/ 1.0 N) samples-sum) (get-zero-vector-as-matrix p))
        samples-unnorm-cov (if (> N 0)
                             (m/add (m/mul (/ 1.0 N) samples-squared-sum)
                                    (m/mul (/ -1.0 (* N N))
                                           (m/mmul samples-sum
                                                   (m/transpose samples-sum))))
                             (get-zero-matrix p))
        samples-mean-minus-mu (m/sub samples-mean mu)
        mu-prime (m/add (m/mul (/ kappa (+ kappa N))
                               mu)
                        (m/mul (/ 1.0 (+ kappa N))
                               samples-sum))
        kappa-prime (+ kappa N)
        nu-prime (+ nu N)
        Psi-prime (m/add Psi
                         samples-unnorm-cov
                         (m/mul (/ (* kappa N) (+ kappa N))
                                (m/mmul samples-mean-minus-mu
                                        (m/transpose samples-mean-minus-mu))))]
    [(- nu-prime (dec p))
     mu-prime
     (m/mul (/ (inc kappa-prime)
               (* kappa-prime (- nu-prime (dec p))))
            Psi-prime)]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;gmm-iris-collapsed/niw-mvn-posterior-predictive</span>","value":"#'gmm-iris-collapsed/niw-mvn-posterior-predictive"}
;; <=

;; **
;;; Finally, we introduce the code for the Normal-inverse-Wishart-Multivariate-Normal XRP:
;; **

;; @@
;; Input: initial hyperparameters of
;;        the Normal-inverse-Wishart-Multivariate-Normal process.
;; Output: random process object, which
;;   produces the posterior predictive of NiW-MVN;
;;   and when absorbs, given a sample, returns the same process
;;   with updated hyperparameters.
(defproc niw-mvn-process
  "multivariate normal process with the unknown mean and covariance"
  [mu kappa nu Psi]
  [N 0
   samples-sum (get-zero-vector-as-matrix (first (m/shape Psi)))
   samples-squared-sum (get-zero-matrix (first (m/shape Psi)))]
  (produce [this]
           (apply multivariate-t
                  (niw-mvn-posterior-predictive mu kappa nu Psi N
                                                           samples-sum samples-squared-sum)))
  (absorb [this sample]
          (niw-mvn-process mu kappa nu Psi
                              (inc N)
                              (m/add samples-sum sample)
                              (m/add samples-squared-sum
                                     (m/mmul sample
                                             (m/transpose sample))))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#&lt;MultiFn clojure.lang.MultiFn@37f8fb37&gt;</span>","value":"#<MultiFn clojure.lang.MultiFn@37f8fb37>"}
;; <=

;; **
;;; In a similar way, we also introduce a Dirichlet-Discrete XRP:
;; **

;; @@
;; Dirichlet-Discrete random process
;; Input: initial Dirichlet hyperparameters.
;; Output: a random process that
;;   produces a discrete distribution with the posterior predictive weights;
;;   and when absorbs, given a sample, returns the same random process,
;;   with updated hyperparameters.
(defproc dirichlet-discrete
  "Dirichlet-Discrete process with concentration hyper-parameters"
  [alphas]
  [counts (vec (repeat (count alphas) 0))]
  (produce [this]
           (let [unnormalised-probabilities (m/add alphas counts)]
             (discrete unnormalised-probabilities)))
  (absorb [this sample]
          (dirichlet-discrete alphas
                                (assoc counts sample (inc (nth counts sample))))))

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-unkown'>#&lt;MultiFn clojure.lang.MultiFn@37f8fb37&gt;</span>","value":"#<MultiFn clojure.lang.MultiFn@37f8fb37>"}
