;; **
;;; Once the new XRPs are defined, we can finally define the Gaussion mixture model as an Anglican program, conditioning on the Iris data, in the following cell.
;; **

;; @@
;; helper methods
(defn row-mean [data] (op// (reduce op/+ data) (m/row-count data)))
(defn invert
  ([W] (linalg/solve W))
  ([kappa W] (linalg/solve (op/* kappa W))))

(require '[clojure.core.matrix.stats :only [mean]])

(defn calc-cov-matrix
  "calculates the covariance matrix of data"
  [data]
  (let
    [deviation-scores (m/sub data (clojure.core.matrix.stats/mean data))]
    (m/mul
      (m/mmul (m/transpose deviation-scores) deviation-scores)
      (/ 1 (first (m/shape data))))))

;; bring required primitive procedures into our namespace
(use '[clojure.core.matrix :only [shape identity-matrix get-row mmul]])

(defn arraysubvector-to-matrix
  "converts the value of the ArraySubVector (clojure.core.matrix)
  to the matrix (the same library)"
  [array-subvector]
  (m/reshape (m/to-vector array-subvector) (conj (m/shape array-subvector) 1)))

;; model definition
(with-primitive-procedures [row-mean invert shape identity-matrix get-row
                            calc-cov-matrix mmul
                            niw-mvn-process dirichlet-discrete
                            produce-matrix-from-vector arraysubvector-to-matrix]
  (defquery gmm-collapsed [data & [hyperparams]]
    (println "provided hyperparameters:" hyperparams)
    (let [[N D] (shape data)

          ;; there are many hyperparameters; we provide defaults
          K 		(:K 		hyperparams	10)
          alpha 	(:alpha		hyperparams	0.1)
          mu-0		(:mu-0		hyperparams (row-mean data))
          lambda-0 	(:lambda-0	hyperparams	(mmul (calc-cov-matrix data) 1.0))
          nu		(:nu		hyperparams	(inc D))
          kappa		(:kappa		hyperparams 0.1)
          create-mvn-process (fn [] (XRP (niw-mvn-process (arraysubvector-to-matrix mu-0) kappa nu lambda-0)))

          ;; sample the latent variables.
          ;;
          ;; mu and sigma are per-cluster; ideally we would sample them lazily
          dirichlet-discrete-process (XRP (dirichlet-discrete (repeat K alpha)))
          mvn-process (into [] (repeatedly K create-mvn-process))]
      ;; for each data point, sample z[n] and `observe`
      (loop [n 0
             z []]
        (if (= n N)
          (predict :z z)
          (let [row (get-row data n)
                k (SAMPLE dirichlet-discrete-process)]
            (OBSERVE (get mvn-process k) (arraysubvector-to-matrix row))
            (recur (inc n) (conj z k))))))))
