;; <=

;; **
;;; In such a situation, given just the measurement data @@\\{ \mathbf{x}_n \\}@@, we may wish to ask questions such as 
;;; 
;;; * "Are two different measurements @@\mathbf{x}_i@@, @@\mathbf{x}_j@@ of the same or different Iris variety?"
;;; * "In the 150 total different measurements, how many different species of flowers might there be?"
;;; 
;;; Notice that these are qualitatively different tasks than _label prediction_ that we may attempt using (say) logistic regression, and labeled training data.
;; **

;; **
;;; Now, we draw some samples from the model defined above using Particle Gibbs (PGibbs) inference. We plot these samples.
;; **

;; @@
(defn draw-sample-sequencies [model n-sample-sequencies n-particles]
  "simple helper to sample sequencies from the posterior using PGibbs and thin them; throw out 50% as burnin"
  (let
    [samples (take n-sample-sequencies (take-nth 2 (take-nth n-particles (doquery :pgibbs model [X {:K 5}] :number-of-particles n-particles))))
     predicts (map :z (map get-predicts samples))]
    predicts))

;; draw samples; thin
(def samples (draw-sample-sequencies gmm-collapsed 10 10))

;; plot them, each; see how the samples evolve?
(map (fn [sample]
       (let [y-hat sample]
         (plot-pca X y-hat #(get colors %))))
     samples)

